import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Header } from './components/Header/Header';
import Home from './pages/Home';


function App() {
    return (
        <>
        <Router>
            <Header />
            <Switch>
                <Route exact path="/" Component={Home} />
            </Switch>
        </Router>
        </>
    );
}

export default App;
